from django.db import modelsfrom apps.account.models.patients import PatientModelfrom apps.logus.models import ServiceModel, BookedRoomModelclass BookingModel(models.Model):    patient = models.ForeignKey(PatientModel, on_delete=models.CASCADE, related_name='bookings')    service = models.ForeignKey(ServiceModel, on_delete=models.CASCADE)    booked_room = models.ForeignKey(BookedRoomModel, on_delete=models.CASCADE)    start_date = models.DateTimeField()    end_date = models.DateTimeField()